    return (
        <div className="container-map">
            <GoogleMapReact
                bootstrapURLKeys={{ key: 'AIzaSyCWBxlNpEtAk1yi9lgZ5WeW89b5pdva0Ek' }}
                center={mapCenter}
                defaultZoom={15}
            >
                {stores.map(p => (
                    <Marker store={p} lat={p.location.lat} lng={p.location.lng} />
                ))}
            </GoogleMapReact>
        </div>
    );
}

export default Map;
